    <Container>
        <Row>
            <Col size="md-6">
                <Card>


                </Card>
            </Col>
            <Col size="md-6">
                <Card>
                    <AddGroup />
                </Card>
            </Col>
        </Row>

    </Container >

);

export default ServiceMenu;
